import React from 'react';
import { NavLink } from 'react-router-dom';


function Left() {
  return (
    <div className="left-sidebar">
      <h3>Left Sidebar</h3>
      <ul>
      
        <li> <NavLink className="navbar-brand" to="/Brand">Brand</NavLink></li>
        <li>Cart</li>
        <li>Category</li>
        <li>Items</li>
        <li>Staff</li>
      </ul>
    </div>
  );
}

export default Left;
